/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */

// Using Quickselect algorithm
var findKthLargest = function (nums, k) {
    function quickSelect(start, end, indexToFind) {
        const pivotIndex = partition(start, end);
        if (pivotIndex === indexToFind) {
            return nums[pivotIndex];
        } else if (pivotIndex > indexToFind) {
            return quickSelect(start, pivotIndex - 1, indexToFind);
        } else {
            return quickSelect(pivotIndex + 1, end, indexToFind);
        }
    }
    function partition(start, end) {
        const pivot = nums[end];
        let pivotIndex = start;
        for (let i = start; i < end; i++) {
            if (nums[i] > pivot) {
                [nums[i], nums[pivotIndex]] = [nums[pivotIndex], nums[i]];
                pivotIndex++;
            }
        }
        [nums[pivotIndex], nums[end]] = [nums[end], nums[pivotIndex]]
        return pivotIndex;
    }
    return quickSelect(0, nums.length - 1, k - 1);
};

